      SELECT DISTINCT - col1 + + + 18 + - + col1 + CAST ( col0 AS INTEGER ) + + col2 * + col2 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT + 66 NOT BETWEEN NULL AND + 26;
  - name: tab2

outputs:
  - name: q10584.out
    data: |
